// bitwise
var findTheDifference = function(s, t) {
  let sum = 0;
  for(var i=0; i<s.length; i++){
    sum ^= s[i].charCodeAt() ^ t[i].charCodeAt()
  }
  sum ^= t[i].charCodeAt()
  return String.fromCharCode(sum)
}

